import styles from '../styles/scss/sign-in.module.scss';

const Login = () => {
	return (
		<main className={styles.loginContainer}>
			<section className={styles.logoHeader}>
				<img src="/images/logo.jpg" />
			</section>
			<section className={styles.loginContent}>
				<div className={styles.cartoonImage}>
					<img src="/images/cartoon-youtube.png" alt="Youtube Workflow" />
				</div>
				<div className={styles.loginTxt}>asdasd</div>
			</section>
		</main>
	);
};

export default Login;
